import React, { Component } from "react";
import ChoiceContainer from './ChoiceContainer';
import { filterCatagories } from "../data/filtercatagorydata";

export default class FilterItem extends Component {
  render() {
    const {catagoryData} = this.props;
    return (
      <div className="col-xl-3 col-md-4" key={catagoryData.key}>
        <h5>{catagoryData.name}</h5>
        <ChoiceContainer catagoryData={catagoryData.options} />
      </div>
    );
  }
}
